        /// <summary>
        /// 把单个字符转换成拼音(全拼)
        /// </summary>
        /// <param name="ch"></param>
        /// <returns></returns>
        public static string Get(char ch)
        {
            var s = ch.ToString();
            if (dictionary.ContainsKey(ch))
                return GetCache(ch);
            //// 拉丁字符            
            //if (ch <= '\x00FF') return s;

            //// 标点符号、分隔符            
            //if (Char.IsPunctuation(ch) || Char.IsSeparator(ch)) return s;
            // 非中文字符            
            if (ch < '\x4E00' || ch > '\x9FA5') return s;
            //0x4E00,0x9FA5
            byte[] local = Encoding.BigEndianUnicode.GetBytes(s);
            //if (local.Length > 1 && local[0] >= 0x4E)
            //{
            int index = SpellIndex[local[0] - 0x4E, local[1]];
            if (index > 0)
            {
                Set(ch, SpellCode[index - 1]);
                return SpellCode[index - 1];
            }
            //}
            return s;
        }
        /// <summary>
        /// 得到单个字符的首字母
        /// </summary>
        /// <param name="c"></param>
        /// <returns></returns>
        public static string GetInitial(char c)
        {
            return Get(c).Substring(0, 1);
        }

        /// <summary>
        /// 得到字符串的首字母
        /// </summary>
        /// <param name="s"></param>
        /// <param name="split"></param>
        /// <returns></returns>
        public static string GetInitial(string s, string split = null)
        {
            if (string.IsNullOrEmpty(s)) return String.Empty;

            var result = new StringBuilder(s.Length + 1);
            var chs = s.ToCharArray();

            for (var j = 0; j < chs.Length; j++)
            {
                result.Append(GetInitial(chs[j]));
                if (split != null && j != chs.Length - 1)
                    result.Append(split);              
            }
            return result.ToString();
        }

        /// <summary>
        /// 把汉字转换成拼音(全拼)
        /// </summary>
        /// <param name="s"></param>
        /// <param name="split">是否在每个汉字间分隔</param>
        /// <returns></returns>
        public static string Get(string s, string split = null)
        {
            if (string.IsNullOrEmpty(s)) return String.Empty;

            var result = new StringBuilder(s.Length * 7);

            var chs = s.ToCharArray();
            for (var j = 0; j < chs.Length; j++)
            {
                result.Append(Get(chs[j]));
                if (split != null && j != chs.Length - 1)
                    result.Append(split);
            }

            return result.ToString();
        }

        /// <summary>
        /// 取和拼音相同的汉字列表
        /// </summary>
        /// <param name="pinyin"></param>
        /// <returns>取拼音相同的汉字列表，如拼音“ai”将会返回“唉爱……”等</returns>
        public static string GetChineseTxt(string pinyin)
        {
            if (string.IsNullOrWhiteSpace(pinyin)) return string.Empty;

            string key = pinyin.Trim().ToLower();

            foreach (string str in Chinese)
            {
                if (str.StartsWith(key + " ") || str.StartsWith(key + ":"))
                    return str.Substring(7);
            }

            return string.Empty;
        }
